import React from 'react';
import { Form } from 'react-bootstrap';
import './Test.css'

const Test = () => {
  return (
    <Form.Group controlId="genderSelect">
      <Form.Label>Gender</Form.Label>
      <Form.Select>
        <option value="male">Male</option>
        <option value="female">Female</option>
      </Form.Select>
    </Form.Group>
  );
};

export default Test;
